export function Render() {
	sendColors(0, 0, 16);
	sendColors(1, 8, 17);
}

export function Shutdown() {
	sendColors(0, 0, 16, true);
	sendColors(1, 8, 17, true);
}

function sendColors(speaker, start, crc, shutdown = false) {
	let packet = [];

	packet[2] = 0x1F;
	packet[6] = 0x1D;
	packet[7] = 0x0F;
	packet[8] = 0x03;
	packet[11] = speaker;
	packet[13] = 0x07;

	for(let iIdx = 0; iIdx < 8; iIdx++){
		let iPxX = vLedPositions[start+iIdx][0];
		let iPxY = vLedPositions[start+iIdx][1];
		var col;

		if(shutdown){
			col = hexToRgb(shutdownColor);
		}else if (LightingMode === "Forced") {
			col = hexToRgb(forcedColor);
		}else{
			col = device.color(iPxX, iPxY);
		}

		let iLedIdx = (iIdx*3) + 14;

		packet[iLedIdx] = col[0];
		packet[iLedIdx+1] = col[1];
		packet[iLedIdx+2] = col[2];
	}
	packet[89] = crc;
	device.send_report(packet, 91);
	device.pause(1);
}

function hexToRgb(hex) {
	let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
	let colors = [];
	colors[0] = parseInt(result[1], 16);
	colors[1] = parseInt(result[2], 16);
	colors[2] = parseInt(result[3], 16);

	return colors;
}

export function Validate(endpoint) {
	return endpoint.interface === 1 && endpoint.usage === 0x0003 && endpoint.usage_page === 0x0001 && endpoint.collection === 0x0000;
	//return endpoint.interface === 0 && endpoint.usage === 0x0001 && endpoint.usage_page === 0x000c && endpoint.collection === 0x0001;
	//return endpoint.interface === 0 && endpoint.usage === 0x0000 && endpoint.usage_page === 0x0001 && endpoint.collection === 0x0002;
}

